import React from 'react';
import { Box, Typography, Grid, Card, CardActionArea, CardContent, CardMedia, Drawer, List, ListItem, ListItemButton, ListItemText } from '@mui/material';
import { useNavigate } from 'react-router-dom';

const brandList = [
  { name: 'Wilson', logo: '/images/logos/wilson.png' },
  { name: 'Babolat', logo: '/images/logos/babolat.png' },
  { name: 'Head', logo: '/images/logos/head.png' },
  { name: 'Prince', logo: '/images/logos/prince.png' },
  { name: 'Yonex', logo: '/images/logos/yonex.png' },
];

const MainPage: React.FC = () => {
  const navigate = useNavigate();

  const handleBrandClick = (brandName: string) => {
    // 해당 브랜드 라켓 페이지로 이동 (예: /racquet/wilson)
    navigate(`/racquet/${brandName.toLowerCase()}`);
  };

  return (
    <React.Fragment>
      {/* 좌측 사이드바 */}
      <Drawer 
        variant="permanent" 
        anchor="left" 
        sx={{ width: 200, flexShrink: 0,
              '& .MuiDrawer-paper': { width: 200, boxSizing: 'border-box', top: 'auto' } }}
      >
        <Box sx={{ overflow: 'auto', mt: 2 }}>
          <Typography variant="h6" sx={{ textAlign: 'center', mb: 2 }}>
            Tennis Racquets
          </Typography>
          <List>
            <ListItem disablePadding>
              <ListItemButton onClick={() => handleBrandClick('all')}>
                <ListItemText primary="Shop All" />
              </ListItemButton>
            </ListItem>
            {brandList.map((brand) => (
              <ListItem key={brand.name} disablePadding>
                <ListItemButton onClick={() => handleBrandClick(brand.name)}>
                  <ListItemText primary={brand.name} />
                </ListItemButton>
              </ListItem>
            ))}
          </List>
        </Box>
      </Drawer>

      {/* 메인 컨텐츠 영역 */}
      <Box sx={{ flex: 1, p: 4, ml: '200px' }}>
        <Typography 
          variant="h4" 
          sx={{ mb: 4, fontWeight: 'bold', textAlign: 'center' }}
        >
          Shop Racquets by Brand
        </Typography>
        <Grid container spacing={4} justifyContent="center">
          {brandList.map((brand) => (
            <Grid item key={brand.name} xs={6} sm={4} md={3} lg={2}>
              <Card>
                <CardActionArea onClick={() => handleBrandClick(brand.name)}>
                  <CardMedia
                    component="img"
                    image={brand.logo}
                    alt={brand.name}
                    sx={{ height: 150, objectFit: 'contain', p: 2 }}
                  />
                  <CardContent>
                    <Typography variant="subtitle1" textAlign="center">
                      {brand.name}
                    </Typography>
                  </CardContent>
                </CardActionArea>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Box>
    </React.Fragment>
  );
};

export default MainPage;
